import './Home.css';
import Button from '@mui/material/Button';
import {useNavigate } from 'react-router-dom';

export default function Home() {
  const navigate = useNavigate()
  return (
    <>
      <h1>Welcome to Best-Fit Colleges</h1> 
      <p className = "descriptions">Find the best colleges for you.</p>
      <div className = "buttons">
        <Button variant="contained" onClick={() => navigate('Tab1')}>Search Colleges</Button>
        <Button variant="contained" onClick={() => navigate('Tab3')}>School Wishlists</Button>
      </div>
    </>
  );
}
